import React from 'react';
import {BrowserRouter} from 'react-router-dom';

// les routes
import PageRoute from '../../routers';
import AddSalarie from '../../components/salarie/'

import './dashboard.css';
import Topbar from '../pages/topbar';
import Sidebar from '../pages/sidebar';
import Section from '../pages/sections';
import AdminSection from '../pages/adminSection';



const Dashboard = () => {
    return(
            <BrowserRouter>
                <Route to='/addSalarie' component={addSalarie} />
                <Topbar />
                <div className="main-layout">
                    <Sidebar />
                    <Section routes={PageRoute} />
                    <AdminSection />
                </div>
                <div className="footer">Footer de notre site, créer par le dévéloppeur kratos bosse</div>
            </BrowserRouter>
    )
}

export default Dashboard;
